import { configureStore } from "@reduxjs/toolkit";
import NotesReducer from "../reducers/NotesReducer";
import UserReducer from "../reducers/UserReducer";
const store = configureStore({
    reducer:UserReducer,
    reducer:NotesReducer
})

export default store;
